import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [accounts, setAccounts] = useState([]);
  const [name, setName] = useState('');
  const [initialBalance, setInitialBalance] = useState('');
  const [message, setMessage] = useState('');

  const API_URL = process.env.REACT_APP_API_URL || '/api'; // Usar proxy en desarrollo, o ruta directa en producción

  const fetchAccounts = async () => {
    try {
      const response = await fetch(`${API_URL}/accounts`);
      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }
      const data = await response.json();
      setAccounts(data);
    } catch (error) {
      console.error("Error fetching accounts:", error);
      setMessage(`Error al cargar cuentas: ${error.message}`);
    }
  };

  const createAccount = async (e) => {
    e.preventDefault();
    setMessage('');
    try {
      const response = await fetch(`${API_URL}/accounts`, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ name, initialBalance: parseFloat(initialBalance) }),
      });
      if (!response.ok) {
        const errorData = await response.json();
        throw new Error(errorData.message || `HTTP error! status: ${response.status}`);
      }
      const newAccount = await response.json();
      setMessage(`Cuenta '${newAccount.name}' creada con éxito! ID: ${newAccount.id}`);
      setName('');
      setInitialBalance('');
      fetchAccounts(); // Refresh the list
    } catch (error) {
      console.error("Error creating account:", error);
      setMessage(`Error al crear cuenta: ${error.message}`);
    }
  };

  useEffect(() => {
    fetchAccounts();
  }, []);

  return (
    <div className="App">
      <nav className="navbar">
        <h1>JFBS - Joseph Fabian Banking System</h1>
        <ul>
          <li><a href="#create">Crear Cuenta</a></li>
          <li><a href="#list">Listar Cuentas</a></li>
        </ul>
      </nav>

      <div className="container">
        <section id="create">
          <h2>Crear Nueva Cuenta</h2>
          <form onSubmit={createAccount}>
            <div>
              <label>Nombre:</label>
              <input
                type="text"
                value={name}
                onChange={(e) => setName(e.target.value)}
                required
              />
            </div>
            <div>
              <label>Monto Inicial:</label>
              <input
                type="number"
                value={initialBalance}
                onChange={(e) => setInitialBalance(e.target.value)}
                min="0"
                step="0.01"
                required
              />
            </div>
            <button type="submit">Crear Cuenta</button>
          </form>
          {message && <p className="message">{message}</p>}
        </section>

        <section id="list">
          <h2>Cuentas Disponibles</h2>
          {accounts.length === 0 ? (
            <p>No hay cuentas disponibles.</p>
          ) : (
            <table>
              <thead>
                <tr>
                  <th>ID</th>
                  <th>Nombre</th>
                  <th>Balance</th>
                </tr>
              </thead>
              <tbody>
                {accounts.map((account) => (
                  <tr key={account.id}>
                    <td>{account.id}</td>
                    <td>{account.name}</td>
                    <td>${account.balance.toFixed(2)}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          )}
        </section>
      </div>
    </div>
  );
}

export default App;
